import React from 'react';
import { Route, Redirect} from 'react-router-dom';
import {isLogin} from './indexRoute';

const PrivateRouters = ({component: Component, ...rest}) => {
    return(
        <Route {...rest} render={props => (
            isLogin() ?
                <Component {...props} />
            : <Redirect to="/SignIn" />
        )} />
    )
}
export default PrivateRouters;
